summary:
{'sentences': ['TRUMBULL —', 'In a release, Trumbull police Lt. Eric Weir said Daniel Ervin, a 38-year-old from Binghamton, N.Y., was arrested a short distance from the bank on Friday after attempting to make a transaction and being recognized by an employee who saw him during a withdrawal he made the day before.

', 'Weir said Ervin was located walking a short distance away from the bank where he was taken into police custody.', 'Due to Ervin’s illegal activity the previous day, he said, and him having no documentation to support having access to the account, he eventually left the bank after being denied the option to make any further transactions.

', 'That day, Weir said, Ervin was successful in using fraudulent identification to withdraw $2,000 from a business account.']}
